create table karyawan
(
    id_karyawan     varchar(255) not null
        primary key,
    nama_karyawan   varchar(255) not null,
    status_karyawan varchar(255) not null,
    tanggal_masuk   date,
    tanggal_keluar  date,
    alamat_karyawan text,
    jenis_kelamin   varchar(255)
        constraint karyawan_jenis_kelamin_check
            check ((jenis_kelamin)::text = ANY
                   (ARRAY [('Pria'::character varying)::text, ('Wanita'::character varying)::text, ('Lainnya'::character varying)::text])),
    nik             varchar(255),
    tanggal_lahir   date,
    email           varchar(255)
);

alter table karyawan
    owner to hrd;

